                                                                                                                                                                                                                                                    "H": "interface IDynFieldSimple {\r\n    name: \"text\" | \"numeric\" | \"money\" | \"multiline\" | \"date\"\r\n}\r\n\r\ntype DynLocalizationGuid = string;\r\ninterface IDynFieldOption {\r\n    label: DynLocalizationGuid | string;\r\n    value: string;\r\n}\r\ninterface IDynFieldOptions {\r\n    name: \"combobox\" | \"multiselect\";\r\n    options: Array<IDynFieldOption>\r\n}\r\n\r\ninterface IDynamicField {\r\n    fieldName: string;\r\n    label: DynLocalizationGuid | string;\r\n    format?: string\r\n    type: IDynFieldOptions | IDynFieldSimple;\r\n}\r\ninterface IDynamicGroup {\r\n    groupName: string;\r\n    label?: DynLocalizationGuid | string;\r\n    boxWithCard?: boolean;\r\n    layout?: number;\r\n    fields: Array<IDynamicField>;\r\n}\r\ninterface IDynamicUIFields {\r\n    groups: Array<IDynamicGroup>;\r\n    localization: Record<string, Record<string, string>>;\r\n}\r\n\r\ninterface IDynamicValGroups {\r\n    groupName: string;\r\n    fields: any\r\n}\r\n\r\ninterface IDynamicScreenModel {\r\n    uiFields: IDynamicUIFields;\r\n    serviceFields: Array<IDynamicValGroups>\r\n}\r\n\r\n\r\n\r\nCreateGroup();\r\n\r\nfunction CreateGroup() {\r\n    debugger;\r\n    const LRPrefix = \"LR_\";\r\n\r\n    const dynamicModel: IDynamicScreenModel = quick.store.get('dynamicModel') ?? {\r\n        uiFields: { groups: [], localization: { \"tr-TR\": {}, \"en-US\": {} } },\r\n        serviceFields: []\r\n    };\r\n\r\n    const groupLRID = LRPrefix + (<any>components.txtGroupName).internalValue;\r\n    const groupName = (<any>components.txtGroupName).internalValue ?? \"defaultGroup\";\r\n\r\n    dynamicModel.uiFields.groups.push({\r\n        \"groupName\": groupName,\r\n        \"label\": groupLRID,\r\n        \"layout\": (<any>components.cbLayout).internalValue?.value,\r\n        \"boxWithCard\": (<any>components.chkAddCard).internalValue,\r\n        \"fields\": []\r\n    });\r\n\r\n    dynamicModel.serviceFields.push({\r\n        \"groupName\": groupName,\r\n        \"fields\": []\r\n    });\r\n\r\n    //LRID Business - Dil Dynamic Eklenecek mi? nyzde validation olacak m? Hangi dili girerse onu modele setle?\r\n    if ((<any>components.txtLabelTR).internalValue)\r\n        dynamicModel.uiFields.localization[\"tr-TR\"][groupLRID] = (<any>components.txtLabelTR).internalValue;\r\n    if ((<any>components.txtLabelEN).internalValue)\r\n        dynamicModel.uiFields.localization[\"en-US\"][groupLRID] = (<any>components.txtLabelEN).internalValue;\r\n\r\n\r\n    quick.store.set('dynamicModel', dynamicModel);\r\n\r\n    const groupComboItems = dynamicModel.uiFields.groups.map((grp) => { return { \"text\": grp.groupName, \"value\": grp.groupName } });\r\n    components.comboGroupName.items = groupComboItems;\r\n    components.cbTableGroupList.items = groupComboItems;\r\n}\r\n\r\n\r\nquick.Quick.reset('groupContainer');",
